"""# Resize and place all data into 1 folder"""

folders = ['/content/dirty-documents/test', '/content/dirty-documents/train',
           '/content/lrde/input', '/content/tobacco/Tobacco3482-jpg']

def saveResizeDirtyDoc(index):
  for img in os.listdir(folders[index]):
    img_path = folders[index] + "/" + img
    document_img = cv2.imread(img_path)
    dim = 600, int(1.32 * 600)
    document_img = cv2.resize(document_img, dim, interpolation= cv2.INTER_AREA)
    new_path = "/content/document_images/" + img
    cv2.imwrite(new_path, document_img)

def saveResizeLRDE():
  root = "/content/lrde/input"
  for img in os.listdir(root):
    img_path = root + "/" + img
    document_img = cv2.imread(img_path)
    dim = 600, int(1.32 * 600)
    document_img = cv2.resize(document_img, dim, interpolation= cv2.INTER_AREA)
    new_path = "/content/document_images/" + img
    cv2.imwrite(new_path, document_img)

def saveResizeTobacco():
  root = "/content/tobacco/Tobacco3482-jpg"
  for folder in os.listdir(root):
    folder_path = root + "/" + folder
    for img in os.listdir(folder_path):
      img_path = folder_path + "/" + img
      document_img = cv2.imread(img_path)

      if document_img is not None:
        dim = 600, int(1.32 * 600)
        document_img = cv2.resize(document_img, dim, interpolation= cv2.INTER_AREA)
        new_path = "/content/document_images/" + img
        cv2.imwrite(new_path, document_img)

