"""Save all background images into 1 folder"""

def saveResizeBg():
  root = "/content/dataset"
  for folder in os.listdir(root):
    folder_path = root + "/" + folder
    for img in os.listdir(folder_path):
      img_path = folder_path + "/" + img
      document_img = cv2.imread(img_path)

      if document_img is not None:
        dim = 600, int(1.32 * 600)
        document_img = cv2.resize(document_img, dim, interpolation= cv2.INTER_AREA)
        new_path = "background_images/" + img
        cv2.imwrite(new_path, document_img)

