"""# Generate synthetic data
![image_2023-07-12_221523384.png](data:image/png;base64,)

Perspective transform / Random brightness and contrast / Get mask inverse of images
"""

# perspective transform on 1 image
a = 600
b = int(1.32 * 600)

original = np.float32([[0, 0], [a, 0], [0, b], [a, b]])
x1, y1 = random.randint(0, 200), random.randint(0, 200)
x2, y2 = random.randint(450, a), random.randint(0, 200)
x3, y3 = random.randint(0, 200), random.randint(450, b)
x4, y4 = random.randint(450, a), random.randint(450, b)
transformed = np.float32([[x1, y1], [x2, y2], [x3, y3], [x4, y4]])
M = cv2.getPerspectiveTransform(original, transformed)

# apply on img
img = cv2.imread("/content/document_images/0000008957.jpg")
dim = 600, int(1.32*600)
img = cv2.resize(img, dim, interpolation= cv2.INTER_AREA)

# Random brightness and contrast
brightness = random.randint(25, 50)
contrast = random.random()*2
adjusted_image = np.clip(img * contrast + brightness, 0, 255).astype(np.uint8)

# Random perspective warp
dst = cv2.warpPerspective(adjusted_image, M, dim)
plt.imshow(dst)
# plt.savefig('Test img', dpi=1200)

mask = np.full(dst.shape, 255.)
mask = cv2.warpPerspective(mask, M, dim)
plt.imshow(mask)

# Invert the mask
mask = mask.astype(np.uint8)
inverted_mask = cv2.bitwise_not(mask)
plt.imshow(inverted_mask)

"""Resize background / Crop background / Put background into mask"""

